def k3k6():
    '''
    just quickly draw a tinymap with the gene alignments
    '''
    NBY  = [] # numcells bin y
    import scanpy as sc
    for  disp in [0,.25,.5,.75,1]:
        for seed in range(7):
            for numcells in [500,1500,2500]:
                datal = input.load3k6k(numcells,seed,pathprefix = '/home/ubuntu/repos/HungarianClustering')
                def pp(adata):
                    #adata.var_names_make_unique()
                    sc.pp.filter_cells(adata, min_genes=200)
                    #sc.pp.filter_genes(adata, min_cells=3)
                    sc.pp.normalize_total(adata, target_sum=1e4)
                    sc.pp.log1p(adata)
                    sc.pp.highly_variable_genes(adata, min_mean=0.0125, max_mean=3, min_disp=disp,inplace=True)
                    return adata
                Map(pp,datal)
                k3,k6 = datal
                bins =  np.linspace(0.0125,3,21)
                #plot = draw.tinyUmap((5,2))
                for i in range(20):
                    # 3k
                    targets = np.logical_and( bins[i] < k3.var['means'], k3.var['means'] < bins[i+1])
                    targets = np.logical_and(k3.var['highly_variable'], targets)
                    # sortedids  = np.argsort(k3.var['dispersions_norm'][targets])
                    # plot.next()
                    # plt.ylim(0,5)
                    # plt.scatter(Range(len(sortedids)),k3.var['dispersions_norm'][targets][sortedids], s = 1)
                    # plot.next()
                    # # 6k
                    # plt.ylim(0,5)
                    # plt.scatter(Range(len(sortedids)),k6.var['dispersions_norm'][targets][sortedids], s=1)
                    if sum(targets) == 0:
                        y=0
                    else:
                        y= sum(np.logical_and(k6.var['highly_variable'],targets))/sum(targets)
                    NBY.append([seed,numcells,y,i,disp])
    print(NBY)

